import{r as s,o as d,c,a as e,b as p,w as o,F as i,e as t,d as _}from"./app.9aaa2256.js";import{_ as r}from"./plugin-vue_export-helper.21dcd24c.js";const l={},f=e("h3",{id:"\u65B0\u534E\u533B\u9662\u7684\u84DD\u767D\u836F\u818F\u662F\u6E7F\u75B9\u7279\u6548\u836F\u5417",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#\u65B0\u534E\u533B\u9662\u7684\u84DD\u767D\u836F\u818F\u662F\u6E7F\u75B9\u7279\u6548\u836F\u5417","aria-hidden":"true"},"#"),t(" \u65B0\u534E\u533B\u9662\u7684\u84DD\u767D\u836F\u818F\u662F\u6E7F\u75B9\u7279\u6548\u836F\u5417\uFF1F")],-1),h=t("\u6BCF\u6B21\u8BF4\u5230\u81EA\u5236\u836F\uFF0C\u90FD\u6709\u4EBA\u4E3E\u51FA\u4E00\u4E9B\u77E5\u540D\u81EA\u5236\u836F\u6765\u53CD\u9A73\uFF0C\u6BD4\u5982\u524D\u5929\u63A8\u9001\u7684\u90A3\u7BC7"),b=t("\u5173\u4E8E\u6E7F\u75B9\u818F\u7684\u6587\u7AE0"),m=t("\uFF0C\u5C31\u6709\u4E2A\u8BFB\u8005\u7559\u4E0B\u4E86\u4E0B\u9762\u7684\u8BC4\u8BBA\u3002"),u=_("<p>\u8FD9\u4E0D\u662F\u5173\u4E8E\u4E0A\u6D77\u65B0\u534E\u533B\u9662\u81EA\u5236\u6E7F\u75B9\u818F\u7684\u552F\u4E00\u7559\u8A00\uFF0C\u4E0B\u9762\u8FD9\u4E9B\u90FD\u662F\u524D\u5929\u6536\u5230\u7684\u7559\u8A00\u3002</p><p>\u800C\u4E14\u7F51\u4E0A\u4E5F\u6709\u5F88\u591A\u8FD9\u4E2A\u836F\u818F\u7684\u4EE3\u8D2D\uFF0C\u5F88\u591A\u5BB6\u957F\u52A0\u4EF7\u51E0\u500D\u53BB\u4E70\u8FD9\u4E2A\u795E\u5947\u7684\u836F\u818F\uFF0C\u548C\u5317\u4EAC\u513F\u7814\u6240\u7684\u80A4\u4E50\u971C\u53EF\u8C13\u5357\u5317\u4E24\u6E7F\u75B9\u795E\u836F\u3002</p><p>\u8FD9\u4E2A\u81EA\u5236\u7684\u84DD\u767D\u836F\u818F\u771F\u7684\u5F88\u795E\u5947\u5417\uFF1F\u6211\u4EEC\u628A\u836F\u54C1\u62FF\u8FC7\u6765\u7814\u7A76\u7814\u7A76\uFF0C\u5148\u770B\u770B\u767D\u8272\u7684\u662F\u5565\u3002</p><p>\u7F50\u5B50\u7684\u76D6\u5B50\u4E0A\u5199\u7740\uFF1A\u918B\u9178\u5730\u585E\u7C73\u677E\u4E73\u818F\u3002\u5730\u585E\u7C73\u677E\u662F\u4EC0\u4E48\uFF1F\u5C31\u662F\u6FC0\u7D20\u554A\uFF0C\u8FD9\u4E2A\u767D\u7F50\u5C31\u662F\u5916\u7528\u7684\u6FC0\u7D20\u4E73\u818F\u554A\uFF0C\u5916\u7528\u6FC0\u7D20\u672C\u6765\u5C31\u662F\u6307\u5357\u63A8\u8350\u7684\u4E00\u7EBF\u6CBB\u7597\u7528\u836F\uFF0C\u7528\u6765\u6CBB\u6E7F\u75B9\u6709\u6548\u679C\uFF0C\u8FD9\u6709\u4EC0\u4E48\u597D\u5947\u602A\u7684\u5462\u3002</p><p>\u8FD9\u4E2A\u767D\u7F50\u91CC\u7684\u6FC0\u7D20\u4E5F\u6CA1\u6709\u7279\u522B\u4E4B\u5904\uFF0C\u56E0\u4E3A\u5E02\u573A\u4E0A\u672C\u6765\u5C31\u6709\u51C6\u5B57\u53F7\u7684\u5730\u585E\u7C73\u677E\u4E73\u818F\uFF0C\u4E0D\u540C\u4E4B\u5904\u5C31\u5728\u4E8E\u65B0\u534E\u533B\u9662\u7684\u8FD9\u4E2A\u767D\u7F50\u7684\u6D53\u5EA6\u8981\u4F4E\u4E00\u500D\u3002</p><p>\u90A3\u662F\u4E0D\u662F\u6D53\u5EA6\u8D8A\u4F4E\u8D8A\u597D\u5462\uFF1F\u5E76\u4E0D\u662F\u3002\u6839\u636E\u836F\u6548\u5F3A\u5EA6\u5916\u7528\u6FC0\u7D20\u53EF\u4EE5\u5206\u4E3A7\u7EA7\u3002\u6E7F\u75B9\u5916\u7528\u6FC0\u7D20\u7684\u9009\u62E9\uFF0C\u9700\u8981\u6839\u636E\u75C5\u60C5\u7A0B\u5EA6\u3001\u75C5\u7076\u90E8\u4F4D\u3001\u4F7F\u7528\u76EE\u7684\u7B49\u60C5\u51B5\u505A\u9009\u62E9\u3002</p><p>\u513F\u7AE5\u6E7F\u75B9\u901A\u5E38\u53EA\u9700\u8981\u4F7F\u7528\u5F31\u6548\u5230\u4E2D\u6548\u6FC0\u7D20\uFF0C\u5BF9\u4E2D\u91CD\u5EA6\u75C5\u60C5\u7684\u6025\u6027\u671F\uFF0C\u53EF\u4EE5\u9009\u62E9\u4E2D\u6548\u6FC0\u7D20\uFF0C\u5BF9\u8F7B\u5EA6\u6E7F\u75B9\uFF0C\u6216\u7EF4\u6301\u7528\u836F\uFF0C\u6216\u773C\u5468\u7B49\u7279\u6B8A\u90E8\u4F4D\u7684\u6E7F\u75B9\uFF0C\u5219\u53EF\u9009\u7528\u5F31\u6548\u6216\u6700\u5F31\u6548\u6FC0\u7D20\u3002</p><p>\u767D\u7F50\u7684\u5730\u585E\u7C73\u677E\u6D53\u5EA6\uFF0C\u5C31\u662F\u6700\u5F31\u6548\u5F3A\u5EA6\u7684\u5916\u7528\u6FC0\u7D20\uFF0C\u6240\u4EE5\u5B83\u53EF\u4EE5\u7528\u4E8E\u6CBB\u7597\u513F\u7AE5\u6E7F\u75B9\uFF0C\u5C24\u5176\u662F\u75C5\u60C5\u8F83\u8F7B\u6216\u9700\u8981\u7EF4\u6301\u7528\u836F\u7684\u60C5\u51B5\uFF0C\u4F46\u5E76\u4E0D\u9002\u5408\u6240\u6709\u75C5\u60C5\u7684\u6E7F\u75B9\u3002</p><p>\u800C\u4E14\uFF0C\u5B83\u5E76\u4E0D\u5177\u6709\u4E0D\u53EF\u66FF\u4EE3\u6027\uFF0C\u56E0\u4E3A\u5F31\u6548\u53CA\u6700\u5F31\u6548\u6FC0\u7D20\u672C\u8EAB\u5DF2\u7ECF\u6709\u5F88\u591A\u51C6\u5B57\u53F7\u7684\u6B63\u89C4\u836F\u54C1\u53EF\u9009\u62E9\uFF0C\u6BD4\u5982\u5730\u5948\u5FB7\u4E73\u818F\u3001\u6C22\u5316\u53EF\u7684\u677E\u4E73\u818F\u7B49\u7B49\uFF0C\u76F8\u6BD4\u4E8E\u81EA\u5236\u836F\uFF0C\u51C6\u5B57\u53F7\u7684\u751F\u4EA7\u5DE5\u827A\u66F4\u5B8C\u5584\uFF0C\u8D28\u63A7\u4F53\u7CFB\u66F4\u4E25\u683C\uFF0C\u836F\u54C1\u8D28\u91CF\u4E5F\u66F4\u53EF\u9760\u3002</p><p>\u518D\u770B\u770B\u84DD\u8272\u7684\u662F\u5565\uFF0C\u4E0A\u9762\u7684\u5B57\u5199\u7740\uFF1A\u786B\u9178\u94DC\u950C\u8F6F\u818F\u3002</p><p>\u786B\u9178\u94DC\u6709\u4F5C\u4E3A\u6297\u83CC\u5242\u548C\u6297\u771F\u83CC\u5242\u4F7F\u7528\uFF0C\u786B\u9178\u94DC\u950C\u7528\u5728\u6E7F\u75B9\u4E0A\uFF0C\u786E\u5B9E\u4E0D\u77E5\u9053\u5E72\u561B\u7684\uFF0C\u56E0\u4E3A\u9664\u4E86\u65B0\u534E\u533B\u9662\u81EA\u5DF1\uFF0C\u56FD\u5185\u5916\u90FD\u6CA1\u6709\u8FD9\u6837\u7528\u7684\u3002\u9664\u4E86\u65B0\u52A0\u5761\u56FD\u7ACB\u5927\u5B66\u533B\u9662\u6709\u4E2A\u533B\u751F\u8BBF\u8C08\u91CC\u8BF4\u4E86\u4E00\u53E5\u53EF\u80FD\u6709\u7528\uFF0C\u4ED6\u8BF4\u7684\u7406\u7531\u662F\u6709\u7684\u6E7F\u75B9\u7684\u5B69\u5B50\u53EF\u80FD\u7F3A\u950C\uFF0C\u53EF\u80FD\u53EF\u4EE5\u901A\u8FC7\u76AE\u80A4\u5438\u6536\u8865\u950C[1]\u3002\u8FD9\u662F\u4E00\u4E2A\u5F88\u6709\u8111\u6D1E\u7684\u60F3\u6CD5\uFF0C\u4F46\u5728\u4E2D\u82F1\u6587\u6570\u636E\u5E93\u91CC\u90FD\u627E\u4E0D\u5230\u76F8\u5173\u7814\u7A76\u3002</p><p>\u4E0D\u8FC7\u4ECE\u7F50\u5B50\u4E0A\u7684\u9002\u7528\u75C7\u7684\u7CDC\u70C2\u6E7F\u75B9\u3001\u8113\u76AE\u75C7\u6765\u770B\uFF0C\u65B0\u534E\u533B\u9662\u52A0\u8FD9\u4E2A\u4E3B\u8981\u7684\u76EE\u7684\u5E94\u8BE5\u662F\u4F5C\u4E3A\u6297\u83CC\u5242\u6765\u7528\u3002\u6E7F\u75B9\u7684\u76AE\u80A4\u91D1\u8461\u83CC\u5B9A\u690D\u786E\u5B9E\u5F88\u5E38\u89C1\uFF0C\u4F46\u662F\uFF0C\u6E7F\u75B9\u5E76\u4E0D\u9700\u8981\u5E38\u89C4\u5916\u7528\u6297\u83CC\u5242\u3002</p><p>\u5F53\u524D\u7684\u7814\u7A76\u8868\u660E\uFF0C\u6E7F\u75B9\u4E0D\u8BBA\u662F\u5426\u5408\u5E76\u611F\u67D3\uFF0C\u5916\u7528\u6297\u83CC\u5242\u5747\u672A\u53D1\u73B0\u6709\u660E\u663E\u6536\u76CA\uFF0C\u76F8\u53CD\u4F1A\u6709\u63A5\u89E6\u6027\u76AE\u708E\u6216\u5BFC\u81F4\u66F4\u5E7F\u6CDB\u6297\u83CC\u836F\u8010\u836F\u7684\u987E\u8651\u3002\u7F8E\u56FD\u76AE\u80A4\u5B66\u4F1A\u7684\u6E7F\u75B9\u6307\u5357\u4E5F\u662F\u660E\u786E\u4E0D\u5EFA\u8BAE\u4F7F\u7528\u6297\u5FAE\u751F\u7269\u5236\u5242\u7684\u3002[2]\u552F\u4E00\u7684\u4F8B\u5916\u662F\u6F02\u767D\u5242\u6CE1\u6D74\u548C\u5916\u7528\u83AB\u5339\u7F57\u661F\uFF0C\u6709\u4E2A\u5C0F\u6837\u672C\u968F\u673A\u5BF9\u7167\u7814\u7A76\u53D1\u73B0\u53EF\u4EE5\u6539\u5584\u4E2D\u91CD\u5EA6\u6E7F\u75B9\u5B69\u5B50\u7684\u75C7\u72B6\u3002</p><p>\u6240\u4EE5\u5C31\u6E7F\u75B9\u7684\u5B69\u5B50\uFF0C\u8FD9\u4E2A\u84DD\u7F50\u836F\u818F\u7684\u4F5C\u7528\uFF0C\u6050\u6015\u5C31\u662F\u91CC\u9762\u7684\u836F\u57FA\u80FD\u8D77\u5230\u4E00\u70B9\u4FDD\u6E7F\u4F5C\u7528\u5427\u3002\u767D\u7F50+\u84DD\u7F50\u7684\u672C\u8D28\u5C31\u662F\u4E00\u7F50\u6FC0\u7D20+\u4E00\u7F50\u4FDD\u6E7F\u5242\uFF0C\u4FDD\u6E7F\u5242\u7684\u91CF\u5BF9\u6E7F\u75B9\u6765\u8BF4\u53C8\u592A\u5C11\uFF0C\u800C\u4E14\u91CC\u9762\u8FD8\u542B\u6709\u4E0D\u6070\u5F53\u7684\u6210\u5206\u3002</p><p>\u80AF\u5B9A\u6709\u4EBA\u8981\u73B0\u8EAB\u8BF4\u6CD5\uFF0C\u81EA\u5DF1\u5BB6\u5B69\u5B50\u6E7F\u75B9\u5C31\u662F\u7528\u8FD9\u4E2A\u84DD\u767D\u836F\u818F\u6CBB\u597D\u7684\uFF0C\u4E5F\u53EF\u80FD\u6709\u4EBA\u8BF4\uFF0C\u81EA\u5DF1\u4E4B\u524D\u8BD5\u8FC7\u5176\u5B83\u7684\u6FC0\u7D20\u4E0D\u597D\uFF0C\u5C31\u662F\u6362\u4E86\u8FD9\u4E2A\u84DD\u767D\u836F\u818F\u5C31\u597D\u4E86\uFF0C\u8FD9\u79CD\u53EF\u80FD\u6027\u6709\u5417\uFF1F</p><p>\u5F53\u7136\u53EF\u80FD\u6709\u3002\u4E00\u65B9\u9762\u91CC\u9762\u6709\u6FC0\u7D20\uFF0C\u672C\u8EAB\u53EF\u4EE5\u6CBB\u7597\u5305\u62EC\u6E7F\u75B9\u5728\u5185\u7684\u76AE\u80A4\u708E\u6027\u75BE\u75C5\uFF0C\u53E6\u4E00\u65B9\u9762\u7528\u4E86\u5176\u5B83\u6FC0\u7D20\u6CA1\u597D\uFF0C\u6362\u4E86\u8FD9\u4E2A\u836F\u5C31\u597D\u4E86\uFF0C\u5E76\u4E0D\u4E00\u5B9A\u8BF4\u660E\u5B83\u7684\u6548\u679C\u66F4\u597D\uFF0C\u56E0\u4E3A\u6E7F\u75B9\u4E5F\u53EF\u80FD\u56E0\u4E3A\u7A7A\u6C14\u6E7F\u5EA6\u751A\u81F3\u60C5\u7EEA\u538B\u529B\u7B49\u56E0\u7D20\u800C\u597D\u8F6C\uFF0C\u6216\u8005\u524D\u9762\u7684\u836F\u7528\u7684\u65F6\u95F4\u4E5F\u5DEE\u4E0D\u591A\u4E86\uFF0C\u4E0D\u6362\u8FD9\u4E2A\u836F\u4E5F\u53EF\u80FD\u4F1A\u597D\u3002</p><p>\u800C\u4E14\u8FD9\u4E2A\u767D\u7F50\u672C\u8EAB\u5C31\u662F\u4E00\u4E2A\u975E\u5E38\u5F31\u6548\u7684\u6FC0\u7D20\uFF0C\u5B83\u7684\u6548\u679C\u597D\u4E8E\u5176\u5B83\u6FC0\u7D20\u7684\u53EF\u80FD\u6027\u4E5F\u5F88\u5C0F\u3002\u76EE\u524D\u4E5F\u6CA1\u6709\u7814\u7A76\u8BC1\u5B9E\u767D\u7F50+\u84DD\u7F50\u7684\u6548\u679C\uFF0C\u4F1A\u597D\u4E8E\u4E00\u652F\u5730\u5948\u5FB7\u4E73\u818F+\u4E00\u7F50\u51E1\u58EB\u6797\u3002</p><p>\u53EA\u4E0D\u8FC7\u65B0\u534E\u533B\u9662\u662F\u77E5\u540D\u7684\u5927\u533B\u9662\uFF0C\u8FD9\u4E2A\u84DD\u767D\u836F\u818F\u53C8\u662F\u5B83\u4EEC\u81EA\u5236\u7684\uFF0C\u53C8\u53D6\u4E86\u4E2A\u7279\u522B\u7684\u540D\u79F0\uFF0C\u5F88\u591A\u5BB6\u957F\u5E76\u4E0D\u77E5\u9053\u5B83\u5C31\u662F\u6FC0\u7D20\uFF0C\u6240\u4EE5\u5982\u679C\u78B0\u5230\u6709\u6548\uFF0C\u5BB6\u957F\u5C31\u5F88\u5BB9\u6613\u628A\u5B83\u5F53\u6210\u77E5\u540D\u533B\u9662\u7684\u7279\u6548\u836F\u544A\u8BC9\u5176\u5B83\u5BB6\u957F\uFF0C\u4ECE\u800C\u5F62\u6210\u53E3\u7891\u3002\u800C\u5176\u5B83\u7684\u6FC0\u7D20\u4EA7\u751F\u540C\u6837\u751A\u8005\u66F4\u597D\u7684\u6548\u679C\uFF0C\u5219\u4F1A\u88AB\u8BA4\u4E3A\u7406\u6240\u5F53\u7136\u3002</p><p>\u4E8B\u5B9E\u4E0A\uFF0C\u56E0\u4E3A\u767D\u7F50\u91CC\u7684\u5730\u585E\u7C73\u677E\u6D53\u5EA6\u5F88\u4F4E\uFF0C\u5E76\u4E0D\u9002\u5408\u6E7F\u75B9\u6025\u6027\u53D1\u4F5C\u671F\uFF0C\u5C24\u5176\u662F\u4E2D\u91CD\u5EA6\u7684\u5B69\u5B50\uFF0C\u5B83\u4E5F\u5E76\u4E0D\u662F\u4EC0\u4E48\u6E7F\u75B9\u7279\u6548\u836F\uFF0C\u7528\u4E86\u6CA1\u6548\u4E5F\u5F88\u5E38\u89C1\uFF0C\u78B0\u5230\u7528\u4E86\u6CA1\u6548\u7684\u60C5\u51B5\uFF0C\u65B0\u534E\u533B\u9662\u7684\u533B\u751F\u540C\u6837\u4F1A\u5EFA\u8BAE\u6539\u7528\u5176\u5B83\u6FC0\u7D20\u3002\u4E0B\u9762\u622A\u56FE\u5C31\u662F\u8BE5\u9662\u76AE\u80A4\u79D1\u7684\u9648\u6D01\u533B\u751F\u5728\u7F51\u4E0A\u7ED9\u5176\u5B83\u5BB6\u957F\u7684\u56DE\u590D\u3002</p><p>\u5728\u8FD9\u4E2A\u533B\u751F\u7ED9\u53E6\u5916\u4E00\u4E2A\u60A3\u8005\u7684\u56DE\u590D\u91CC\uFF0C\u6211\u4EEC\u8FD8\u4E86\u89E3\u5230\uFF0C\u8FD9\u4E2A\u84DD\u767D\u836F\u818F\uFF0C\u5F53\u521D\u5176\u5B9E<strong>\u5E76\u4E0D\u662F\u7528\u6765\u6CBB\u7597\u6E7F\u75B9\u7684\uFF0C\u800C\u662F\u7528\u4E8E\u6CBB\u7597\u65B0\u751F\u513F\u75E4\u75AE\u7684</strong>\uFF0C\u8FD9\u4E5F\u5C31\u66F4\u80FD\u7406\u89E3\u4E3A\u4EC0\u4E48\u5B83\u7684\u6FC0\u7D20\u6D53\u5EA6\u8FD9\u4E48\u4F4E\u4E86\u3002</p><p>\u53EA\u4E0D\u8FC7\u6E7F\u75B9\u6BD4\u65B0\u751F\u513F\u75E4\u75AE\u53D1\u75C5\u7387\u9AD8\u592A\u591A\uFF0C\u5E94\u7528\u573A\u666F\u4E5F\u591A\u591A\u4E86\u3002</p><p>\u5BFA\u5E99\u91CC\u7684\u83E9\u8428\u4ECE\u4E0D\u663E\u7075\uFF0C\u540C\u6837\u6709\u4EBA\u53BB\u70E7\u9999\uFF0C\u66F4\u4F55\u51B5\u65B0\u534E\u533B\u9662\u8FD8\u662F\u4E00\u4E2A\u201C\u77E5\u540D\u5BFA\u5E99\u201D\uFF0C\u8FD9\u4E2A\u84DD\u767D\u836F\u818F\u91CC\u9762\u8FD8\u6709\u80FD\u663E\u7075\u7684\u6FC0\u7D20\uFF0C\u6E7F\u75B9\u53C8\u662F\u513F\u7AE5\u591A\u53D1\u75C5\uFF0C\u6240\u4EE5\u5B83\u88AB\u8FFD\u6367\u6210\u4E3A\u6E7F\u75B9\u7279\u6548\u836F\u5C31\u4E00\u70B9\u4E0D\u7528\u5947\u602A\u4E86\u3002</p><p>\u4F46\u5B9E\u9645\u4E0A\uFF0C\u84DD\u767D\u836F\u818F\u6CBB\u6E7F\u75B9\uFF0C\u5C31\u662F\u4F9D\u9760\u767D\u7F50\u91CC\u7684\u5730\u585E\u7C73\u677E\uFF0C\u548C\u642D\u914D\u4E00\u652F\u6FC0\u7D20\u4E00\u8D77\u5F00\u7684\u80A4\u4E50\u971C\u4E00\u4E2A\u9053\u7406\uFF0C\u53EA\u4E0D\u8FC7\u5B83\u7684\u6210\u4EFD\u6BD4\u80A4\u4E50\u971C\u66F4\u6E05\u6670\u4E00\u4E9B\uFF0C\u4E5F\u53EF\u80FD\u76F8\u5BF9\u66F4\u5B89\u5168\u4E00\u4E9B\u3002\u4F46\u5728\u6709\u6B63\u89C4\u836F\u54C1\u53EF\u7528\u7684\u60C5\u51B5\u4E0B\uFF0C\u5B83\u548C\u80A4\u4E50\u971C\u4E00\u6837\uFF0C\u65E9\u5C31\u6CA1\u6709\u5B58\u5728\u7684\u5FC5\u8981\u4E86\u3002</p><p>\u53C2\u8003\u8D44\u6599\uFF1A</p><p>1.https://www.straitstimes.com/singapore/health/controlling-eczema-is-like-firefighting</p><p>2.https://www.jaad.org/article/S0190-9622(14)01257-2/fulltext</p><hr><p>\u76F8\u5173\u9605\u8BFB \uFF1A</p>",28),z=t("\u80A4\u4E50\u971C\u4E0D\u7528\u4EE3\u8D2D\u4E86\uFF0C\u4F46\u503C\u5F97\u4E70\u5417\uFF1F"),x=t("\u4ECE\u80A4\u4E50\u971C\u770B\u513F\u7814\u6240\u81EA\u5236\u836F"),O=t("\u533B\u9662\u81EA\u5236\u836F\uFF0C\u662F\u5B9D\u8D1D\u836F\u8FD8\u662F\u5783\u573E\u836F\uFF1F"),g=t("\u533B\u9662\u81EA\u5236\u836F\uFF0C\u6709\u81EA\u5236\u7684\u5FC5\u8981\u5417\uFF1F"),w={href:"http://mp.weixin.qq.com/s?__biz=MzA5NzE5ODIyOQ==&mid=2651629238&idx=1&sn=277d533374cc0c3015a88b3fd7f2ed38&chksm=8b5c8f4cbc2b065a45fd33feae277792b68d1fbf220fa6b440bfe330e4610f6eae3d76a5cd46&scene=21#wechat_redirect",target:"_blank",rel:"noopener noreferrer"},N=t("\u67E5\u770B\u539F\u6587");function k(E,I){const a=s("RouterLink"),n=s("ExternalLinkIcon");return d(),c(i,null,[f,e("p",null,[h,p(a,{to:"/s/__biz=MzA5NzE5ODIyOQ==&mid=2651629216&idx=1&sn=0ddd51dfa62f6ed4026347eb8896490d/"},{default:o(()=>[b]),_:1}),m]),u,e("p",null,[p(a,{to:"/s/__biz=MzA5NzE5ODIyOQ==&mid=2651626542&idx=1&sn=fd37ee101b9e0ccdc85440865a1a2553/"},{default:o(()=>[z]),_:1})]),e("p",null,[p(a,{to:"/s/__biz=MzA5NzE5ODIyOQ==&mid=2651626548&idx=1&sn=e5f8671e40324b68dae399bbc6c864cc/"},{default:o(()=>[x]),_:1})]),e("p",null,[p(a,{to:"/s/__biz=MzA5NzE5ODIyOQ==&mid=2651627517&idx=1&sn=297a9f36657daa141cb62eaf78925ccd/"},{default:o(()=>[O]),_:1})]),e("p",null,[p(a,{to:"/s/__biz=MzA5NzE5ODIyOQ==&mid=2651627526&idx=1&sn=3a1427a73b24f2d1b8ad54bb452f8992/"},{default:o(()=>[g]),_:1})]),e("p",null,[e("a",w,[N,p(n)])])],64)}var D=r(l,[["render",k]]);exp